description:
Star Wars: Episode III - Revenge of the Sith (2005) 140 min

DESCRIPTION:
Seduced by the dark side, Anakin Skywalker turns against his mentor and becomes Darth Vader. (with two audio commentaries; the first is ported from the 2005 DVD release; the second is edited together from various interviews for the 2011 Blu-ray release)

SPECS IN BRIEF:
M4V file for iTunes/iDevices
V: 1920x816 23.98 fps h.264 @ 4822 Kbps
A: 160 Kbps 2.0 AAC &amp; 384 Kbps 5.1 AC-3 / 96 Kbps AAC 2.0 (commentaries)
S: English, English SDH, Spanish, French, Brazilian Portuguese, Portuguese
C: 50 (Named)

SOURCE:
Retail Blu-ray Disc

PLAYBACK:
Encoded &amp; tagged for iTunes (10.6 or later) and Apple devices that can handle *1080p HD* video. Playback is confirmed for:
  1. 2012 iPad
  2. 2012 AppleTV
  3. 2011 iPad 2 with 5.1 software or later
  4. 2011 iPhone 4S
  5. 2010 AppleTV with 5.0 software or later (will output file as 720p)

